import groovy.sql.Sql

import java.sql.Driver

def csvFilePath = "/home/mszpiler/enotion/repo/postman-soapui-jmeter-qa-training/data/cat-data.csv"
def fileReader = new BufferedReader(new FileReader(csvFilePath))
def rowsData = fileReader.readLines()
int rowsize = rowsData.size()

def driver = Class.forName('org.postgresql.Driver').newInstance() as Driver
def props = new Properties()
props.setProperty("user", "pkko")
props.setProperty("password", "pkko")
def conn = driver.connect("jdbc:postgresql://localhost:8200/pkko_db", props)
def sql = new Sql(conn)

def userUUIDLocal = testRunner.testCase.testSuite.getPropertyValue("userUUID")
def userUUIDObj = UUID.fromString(userUUIDLocal)

log.info "userUUID = " + userUUIDLocal

//start from i = 1 because first row is a header in CSV file
try {
    for (int i = 1; i < rowsize; i++) {

        rowdata = rowsData[i]
        String[] data = rowdata.split(",")

        def raceId = new Integer(data[1])


        def row = sql.firstRow(
                'select count(*) from norad.animals a join norad.users u on u.id = a.user_id ' +
                        'where a.name = :animalName and a.race_id = :animalRaceId and u.uuid = :userUUID',
                [animalName: "mszpiler+" + data[0], animalRaceId: raceId, userUUID: userUUIDObj])

        def rowCount = row.count
        log.info "CSV animalName=" + data[0] + " raceId=" + data[1] + " count=" + rowCount

        assert rowCount > 0

    }
} catch (Exception e) {
    log.info(e.getMessage())
    assert false
}
finally {
    sql.close()
    conn.close()
}

import groovy.json.JsonSlurper

def csvFilePath = "/home/mszpiler/enotion/repo/postman-soapui-jmeter-qa-training/data/many-steps-data.csv"
def fileReader = new BufferedReader(new FileReader(csvFilePath))
def rowsData = fileReader.readLines()
int rowsize = rowsData.size()

def animalUUIDMap = new HashMap()
context.setProperty("animalUUIDMap", animalUUIDMap)

//start from i = 1 because first row is a header in CSV file
for (int i = 1; i < rowsize; i++) {
    rowdata = rowsData[i]
    String[] data = rowdata.split(",")
    def raceId = data[1]
    log.info "CSV animalName=" + data[0] + " raceId=" + raceId
    def animalName = "mszpiler+" + data[0]
    testRunner.testCase.setPropertyValue("animalName", animalName)
    testRunner.testCase.setPropertyValue("raceId", raceId)
    testRunner.runTestStepByName("Create one animal")

    //get response for request "Create one animal"
    def response = context.expand('${Create one animal#Response}')

    //parse response to structure easy to read
    slurperresponse = new JsonSlurper().parseText(response)

    log.info("Animal name =" + animalName + " raceId=" + raceId + " created animal uuid=" + slurperresponse.uuid)

    //setup in context information about created animal uuid and raceId assocciated with this animal
    animalUUIDMapLocal = context.getProperty("animalUUIDMap")
    animalUUIDMapLocal.put(slurperresponse.uuid, raceId)

    //not required
    //context.setProperty("animalUUIDMap", animalUUIDMapLocal)

}

log.info "animal uuid list = " + context.getProperty("animalUUIDMap")

import groovy.json.JsonSlurper

//get saved map with animal uuid and race id
def animalUUIDMap = context.getProperty("animalUUIDMap")

for (entry in animalUUIDMap) {

    def animalUUID = entry.key
    def expectedAnimalRaceId = new Integer(entry.value)

    //setup params for specific step
    def getAnimalDetailsStep = testRunner.testCase.getTestStepByName("Get animal details")
    getAnimalDetailsStep.setPropertyValue("uuid", animalUUID)

    //run specific step
    testRunner.runTestStepByName("Get animal details")

    //read and parse response
    def response = context.expand('${Get animal details#Response}')
    slurperresponse = new JsonSlurper().parseText(response)

    //expected race id should be equal to raceId from response
    assert expectedAnimalRaceId == slurperresponse.raceId
}
